import Vue from 'vue';
import Router from 'vue-router';
import CreateDataComponent from './views/CreateDataComponent.vue'; // Use the correct component name

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: '/create',
      name: 'CreateData', // This name can be kept simple; it's just an identifier
      component: CreateDataComponent, // Match the import name
    },
  ],
});
